import { Fragment } from "react";
import { Outlet } from "react-router-dom";

const Navigaion = () => {
  return (
    <Fragment>
      <div className="navigation">
        <h1>I am the Navigation Bar</h1>
        <Outlet />
      </div>
    </Fragment>
  );
};

export default Navigaion;
